  false,\n\t\"url\": null,\n\t\"notes\": \"This appendix consists of two-dimensional
  marine seismic reflection profile data from Miami, Florida, canals. These data were
  acquired in November and December of 2001 and in January and February of 2002 using
  a 4.9 m (16 ft) jonboat. The data are available in a variety of formats, including
  ASCII,HTML, and GIF images. Reference maps and GIF images of the profiles may be
  viewed with your WWW browser. For more information on the seismic surveys see http://walrus.wr.usgs.gov/infobank/b/b101fl/html/b-1-01-fl.meta.html
  , http://walrus.wr.usgs.gov/infobank/b/b201fl/html/b-2-01-fl.meta.html , http://walrus.wr.usgs.gov/infobank/b/b102fl/html/b-1-02-fl.meta.html
  , and http://walrus.wr.usgs.gov/infobank/b/b202fl/html/b-2-02-fl.meta.html These
  data are also available via GeoMapApp (http://www.geomapapp.org/) and Virtual Ocean
  ( http://www.virtualocean.org/) earth science exploration and visualization applications.\",\n\t\"license_title\":
