  \"graphic-preview-description\",\n\t\t\"value\": \"Trackline map of data collected
  on USGS Field Activities 01ASR01, 01ASR02, 02ASR01, and 02ASR02 in Miami, Florida,
  canals during November and December of 2001 and January and February of 2002. This
  map is in geographic projection. It was created using ESRI GIS software ArcView
  3.2, exported to Adobe Illustrator for further editing, and saved for the web as
  a GIF image. The USGS is not the originator of all the layers used in creating this
  basemap. For example, the coastline layer was developed by ESRI, and the interstates
